||&lt;strong>24 hour Complite&lt;/strong>|&lt;br />
Учитывать изменения Complite calls за&amp;nbsp;последние 24 часа.&lt;br />
||&lt;strong>Complite diff&lt;/strong>|&lt;br />
Учитывать процентную разницу изменения показателя Complite calls.&lt;br />
Предположим нам&amp;nbsp;нужно проследить статистику изменения показателя ASR&amp;nbsp;за&amp;nbsp;последние сутки. &lt;br />
ASR&amp;nbsp;у&amp;nbsp;оператора “Operator 4” за&amp;nbsp;сутки и&amp;nbsp;за последний час&amp;nbsp;остался также неизменным  &amp;ndash; “0.00”, из&amp;nbsp;этого можно сделать заключение что&amp;nbsp;по&amp;nbsp;каким то&amp;nbsp;причинам этот оператор в&amp;nbsp;данное время не&amp;nbsp;работает, звонки на&amp;nbsp;него не&amp;nbsp;проходят.&lt;/div>&lt;/div>
