<item>
<title>2007-02-03 20:33:07</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaTroubleTickets/show&amp;time=2007-02-03+20%3A33%3A07</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaTroubleTickets&amp;amp;v=je6" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Destinations&amp;nbsp;/&amp;nbsp;Форма&amp;nbsp;Trouble&amp;nbsp;Tickets&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaTroubleTickets&amp;amp;time=2007-02-03+20%3A33%3A07">2007-02-03 20:33:07&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelDestinations/FormaTroubleTickets&amp;amp;time=2007-02-03+20%3A41%3A44">2007-02-03 20:41:44&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Здесь ведется статистика изменений показателей качества звонков. Задав контрольные значения для&amp;nbsp;показателей ACD&amp;nbsp;и&amp;nbsp;ASR можно легко проследить их&amp;nbsp;изменение за&amp;nbsp;последние 24 часа.  На&amp;nbsp;следующем рисунке показан вид&amp;nbsp;формы “Trouble tickets”:&lt;br />
Форма состоит из&amp;nbsp;следующих контрольных полей:&lt;br />
||**Поле**|**Назначение**||&lt;br />
||----||&lt;br />
||**Minimal ACD**|
||&lt;br />
||**Minimal ASR**|
||&lt;br />
||**Minimal Complite calls**|
||&lt;br />
||**With calls count**|
||&lt;br />
||**Minimal ACD&amp;nbsp;difference %**|
||&lt;br />
||**Minimal ASR&amp;nbsp;difference %**|
||&lt;br />
||**Minimal Complite calls difference %**|
||&lt;br />
||**Selected by&amp;nbsp;condition parameters**|
||&lt;br />
||**Hour ACD**|
||&lt;br />
||**Hour ASR**|
||&lt;br />
||**Hour Complite**|
||&lt;br />
||**24 hour ACD**|
||&lt;br />
||**24 hour ASR**|
||&lt;br />
||**ACD diff**|
||&lt;br />
||**ASR diff**|
||&lt;br />
||**Complite diff**|
||&lt;br />
Рассмотрим пример работы с&amp;nbsp;формой:&lt;br />
Предположим нам&amp;nbsp;нужно проследить статистику изменения показателя ASR&amp;nbsp;за&amp;nbsp;последние сутки. &lt;br />
Для&amp;nbsp;этого выставим контрольные параметры ASR&amp;nbsp;следующим образом:&lt;br />
&lt;div class="indent">Minimal ASR&amp;nbsp;– 20&lt;br />
With calls count &amp;ndash; 100&lt;br />
Minimal ASR&amp;nbsp;difference % &amp;ndash; 30&lt;br />
Select by&amp;nbsp;condition parameters:&lt;br />
&lt;div class="indent">Hour ASR&amp;nbsp;&amp;ndash; включен&lt;br />
24 hour ASR&amp;nbsp;&amp;ndash; включен&lt;br />
ASR&amp;nbsp;diff – включен&lt;/div>&lt;/div>
Параметры ACD&amp;nbsp;можно не&amp;nbsp;трогать и&amp;nbsp;убрать с&amp;nbsp;них галочки в&amp;nbsp;секции “ Select by&amp;nbsp;condition parameters ”.&lt;br />
Для&amp;nbsp;того чтобы система начала анализ прошедших звонков, нужно нажать кнопку “Show trouble ticket”. В&amp;nbsp;результате, будет показана таблица следующего вида:&lt;br />
В&amp;nbsp;результирующей таблице наглядно показаны изменения показателя ASR&amp;nbsp;за&amp;nbsp;последний час&amp;nbsp;и&amp;nbsp;за последние сутки. По&amp;nbsp;полученным результатам можно сделать следующие выводы:&lt;br />
&lt;ul>&lt;li> Показатель ASR&amp;nbsp;у&amp;nbsp;оператора “Operator 1” ухудшился за&amp;nbsp;последний час. 
&lt;/li>&lt;li> В&amp;nbsp;то время как&amp;nbsp;у&amp;nbsp;оператора “Operator 2” наоборот, ASR&amp;nbsp;улучшился. 
&lt;/li>&lt;li> У&amp;nbsp;оператора “Operator 3” показатель ASR&amp;nbsp;остался без&amp;nbsp;изменений.&lt;/li>&lt;/ul>
ASR&amp;nbsp;у&amp;nbsp;оператора “Operator 4” за&amp;nbsp;сутки и&amp;nbsp;за последний час&amp;nbsp;остался также неизменным  &amp;ndash; “0.00”, из&amp;nbsp;этого можно сделать заключение что&amp;nbsp;по&amp;nbsp;каким то&amp;nbsp;причинам этот оператор в&amp;nbsp;данное время не&amp;nbsp;работает, звонки на&amp;nbsp;него не&amp;nbsp;проходят.&lt;/div>&lt;/div>
</description>
</item>
